import React from 'react';


const OnOff = (props) => /*<button onClick={props.parChangeOnOff}>{props.parOnOff}</button>*/
{
    return(
        <div className="switch demo4">
            <input type="checkbox"></input>
            <label><i class="fa fa-power-off" aria-hidden="true"></i></label>
        </div>
    )
}
        


export default OnOff;
